import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
    {
      path: '/home',
      name: 'Home',
      component: HomeView
    },
  {
    path: '/unnormal',
    name: 'unnormal',
    component: () => import('../views/Unnormal.vue')
  },
  {
	  path: '/administr',
	  name: 'administr',
	  children:[
		  {
			  path:"/",
			  name: 'index',
			  component:()=>import("../views/administer/Index.vue")
		  },
		  {
			  path:"member",
			  name: 'member',
			  component:()=>import("../views/administer/Member.vue")
		  },
		  {
			  path:"role",
			  name: 'role',
			  component:()=>import("../views/administer/Role.vue")
		  },
		  {
			  path:"privileges",
			  name: 'privileges',
			  component:()=>import("../views/administer/Privileges.vue")
		  },
		  {
			  path:"ability",
			  name: 'ability',
			  component:()=>import("../views/administer/Ability.vue")
		  }
	  ],
	  component: () => import('../views/Administr.vue')
  },
  {
  	  path: '/video',
  	  name: 'video',
  	  component: () => import('../views/Video.vue')
  }
]

const router = new VueRouter({
  mode: 'hash',
  base: process.env.BASE_URL,
  routes
})

export default router
